import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom'
import { HomePage, CounterButtonPage, PeopleListPage, NotFound } from './pages'
function App() {
  return (
    <div className="App">
      <Router>
        <Link to="/">Home page</Link>
        <Link to="/people-list">People list page</Link>
        <Link to="/counter">Counter page</Link>
        <Routes>
          <Route path="/" exact element={<HomePage />} />
          <Route path="/counter/:name" exact element={<CounterButtonPage />} />
          <Route path="/people-list" exact element={<PeopleListPage />} />
          <Route element={<NotFound />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
